Borrowed from:
* Persian زکات (zakât);
* Turkish zekât, from Ottoman Turkish زكات (zekat); or
* Urdu زکات;
all from Arabic زَكَاة (zakāh, “almsgiving, zakat; purification”), from زَكَوٰة (zakāh) (archaic), from Aramaic זכותא/ܙܟܘܬܐ (zākūṯā, “goodness, probity, uprightness; merit; victory”), from זכי (zəḵē, “to gain; to overcome, triumph over”).
